import React, { Component } from 'react'
import showDeployedTender from '../components/showDeployedTender';
import {Card,Icon} from 'semantic-ui-react'

export default class Donation extends Component {
  render() {
    return (
      <div>
        <Card>
    <Card.Content header={this.props.address} />
    <Card.Content description="This is the address of deployed tender" />
    <Card.Content extra>
      <Icon name='check' />View
    </Card.Content>
  </Card>
      </div>
    )
  }
}
